import React from 'react'
import {data} from './data'


const Projects = () => {

    return (
        <section id='projects'>
            <div className="container">
                <h2>Projects</h2>
                    {data.map((item) => {
                    const {id, image, title, description, category, url} = item;
                    return <div className="card" style={{backgroundImage: `url(${image})`}}>
                        <div key={id}>
                        <img src={image} alt='' />
                        <h1>{title}</h1>
                    </div>
                    </div>
                    })} 
                </div>
        </section>
    )
}

export default Projects
